import * as actions from '../actions/actionTypes.js'

const initialState = {
    sideDrawerOpne: false,
}

export default (state = initialState, {type, payload}) => {
    switch (type) {
        case actions.CLOSE:
            return { ...state, sideDrawerOpen: true }

        default:
            return state
    }
}
